import React from "react";
import SubTop2 from "Components/SubTop2";

const RegisterPresenter = ({ subTopData }) => {
    const formArr = [
        { type: "아이디", placeholer: "User ID" },
        { type: "비밀번호", placeholer: "Password" },
        { type: "비밀번호 확인", placeholer: "Password (Re-type)" },
        { type: "이름", placeholer: "User name" },
        { type: "이메일 주소", placeholer: "Email Address" },
        { type: "휴대폰 번호", placeholer: "010-0000-0000" },
        { type: "생년월일", placeholer: "Click Here" },
        { type: "우편번호", placeholer: "" },
        { type: "주소", placeholer: "" },
        { type: "성별", placeholer: "남성 / 여성" },
        {
            type: "구분",
            placeholer: "학생 / 학부모 / 교사 중 해당되는 항목을 적어주세요",
        },
        { type: "보호자명", placeholer: "보호자명을 입력해주세요" },
    ];

    return (
        <>
            <SubTop2 subTopData={subTopData} />
        </>
    );
};
export default RegisterPresenter;
